const layoutProps = {

};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">
    <h1><inlineCode parentName="h1">{`tinacms-contentful`}</inlineCode></h1>
    <p>{`A series of libraries aimed to make using TinaCMS with Contentful easy.`}</p>
    <h2>{`Find what you're looking for`}</h2>
    <p>{`Looking to learn how the library works?`}</p>
    <ul>
      <li parentName="ul">
        <p parentName="li">{`Follow the `}<a parentName="p" {...{
            "href": "./getting-started"
          }}>{`Getting Started Guide`}</a>{` to install and get set up`}</p>
      </li>
      <li parentName="ul">
        <p parentName="li">{`Head to the `}<a parentName="p" {...{
            "href": "./api"
          }}>{`API documentation`}</a>{` for detailed developer docs`}<sup parentName="p" {...{
            "id": "fnref-1"
          }}><a parentName="sup" {...{
              "href": "#fn-1",
              "className": "footnote-ref"
            }}>{`1`}</a></sup></p>
      </li>
      <li parentName="ul">
        <p parentName="li">{`Check out one of the following examples:`}</p>
        <ul parentName="li">
          <li parentName="ul">{`Editing an entry from Contentful`}</li>
          <li parentName="ul">{`Using blocks with Contentful`}</li>
        </ul>
      </li>
    </ul>
    <div {...{
      "className": "footnotes"
    }}>
      <hr parentName="div"></hr>
      <ol parentName="div">
        <li parentName="ol" {...{
          "id": "fn-1"
        }}>{`note that this documentation is also available inline when using typescript via type instellisense`}<a parentName="li" {...{
            "href": "#fnref-1",
            "className": "footnote-backref"
          }}>{`â†©`}</a></li>
      </ol>
    </div>
    </MDXLayout>;
}

